import React from 'react';
import './Navbar.scss';

const Navbar: React.FC = () => {
    return (
        <nav className="navbar navbar-expand-sm navbar-light navbar-border flex-nowrap fixed-top">
            <a className="navbar-brand ms-3" href="/">Trainer Management System</a>

            <form className="d-flex">
                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            </form>

            <button className="btn btn-outline-success ms-2" type="submit">Save</button>

            <div className="dropdown ms-2">
                <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                    Time/Calendar
                </button>
                <ul className="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                    <li><a className="dropdown-item" href="#">Action</a></li>
                    <li><a className="dropdown-item" href="#">Another action</a></li>
                    <li><a className="dropdown-item" href="#">Something else here</a></li>
                </ul>
            </div>

            <button className="btn btn-primary ms-2" type="button">Next Action</button>
        </nav>
    );
};

export default Navbar;
